import React, {Fragment} from 'react'
import { Link } from 'react-router-dom';


const Map = () => {
        return (
                <Fragment>
                    <Link to="/Accueil">
                        <div className="retourner">Retourner à l'écran d'accueil </div>
                    </Link>
                    <iframe src="https://www.google.com/maps/d/embed?mid=1b-4C5T8NWi-wupfUUKxQV0tguZjB0ovY" width="100%" height="480"></iframe>
                </Fragment>
        )
}

export default Map
